import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useLocation,
  useRouteMatch,
  useParams
} from "react-router-dom";
import ProjectList from "./components/ProjectList/ProjectList";
import "./App.scss";

function Home() {
  return <h2>Home</h2>;
}

function About() {
  return <h2>About</h2>;
}

var span = document.getElementById('clock');

	      function time() {
	        let d = new Date();
	        let s = d.getSeconds();
	        let m = d.getMinutes();
	        let h = d.getHours();
	        span.textContent = h + ":" + m + ":" + s;
	      }

	      setInterval(time, 1000);

export default function App() {
	let location = useLocation();
	return (
    <Router>
      <div>
        <ul>
        if (location.pathname == "toto") {
          <li>
            <Link to="/">Nos Voyages</Link>
          </li>
        }
          <li>
            <Link to="/index" className="index">Index</Link>
          </li>
          <li>
            <Link to="/nous">nous</Link>
          </li>
          <li>
            <Link to="https://www.google.com/maps/place/Paris/" className="notrePosition">48.8566, 2.3522</Link>
          </li>
        </ul>

        <Switch>
          <Route path="/index">
            <index />
          </Route>
          <Route path="/nous">
            <nous />
          </Route>
          <Route path="/">
			<ProjectList className="App"/>
          </Route>
        </Switch>
      </div>
    </Router>
  );
}
